  h2{
    margin-bottom: 60px;
  }
`
const InfoContainer  = styled.div`
  div{
    margin-bottom: 10px;
    
    h3{
      width: 20%;
    }

    span{
      font-size: 0.8rem;
      width: 70%;
    }
  }

  .flex-full{
    justify-content: flex-start;
    gap: 50px;
    
  }
`
